window.bookSummaryJSON = "<p>Still coming to terms with their unexpected partnership, Augustine and Harlow have a tentative truce. Although with Harlow slowly working to accept being fae, Augustine still learning how to be Guardian, and feelings growing on both sides, they do not have an easy road ahead. </p> <p>But when a young girl is stolen from the Mardi Gras Exemplar Ball - the biggest fae event of the year - Harlow and Augustine must put all their issues aside to bring her home alive. Harlow's father, Branzino, is of course their number one suspect, but evil lurks in every corner of the city and time is running out. Their only choices: Either find a way to rescue the girl, or Augustine must die.</p>"; 
